INSERT INTO public."Categories" VALUES (1, 'Cơ sở hạ tầng và thiết bị', 'Bao gồm các vấn đề liên quan đến phần cứng của các thiết bị (máy tính, máy in, máy chiếu), sự cố mạng (Wifi, LAN, VPN), máy chủ (Server) và cấp phát thiết bị.', 1);
INSERT INTO public."Categories" VALUES (2, 'Phần mềm và bảo mật', 'Bao gồm xử lý lỗi phần mềm nội bộ, cài đặt phần mềm mới, cấp tài khoản công ty, cấp quyền truy cập, reset mật khẩu và kiểm tra bảo mật.', 1);
INSERT INTO public."Categories" VALUES (3, 'Hành chính và phúc lợi', 'Bao gồm quản lý hợp đồng lao động, tính lương/thưởng, giải quyết nghỉ phép, hồ sơ nhân viên và các chính sách công ty.', 2);
INSERT INTO public."Categories" VALUES (4, 'Tuyển dụng và đào tạo', 'Bao gồm đăng tin tuyển dụng, tiếp nhận nhân sự mới, đào tạo phát triển kỹ năng và đánh giá hiệu suất nhân viên.', 2);
INSERT INTO public."Categories" VALUES (5, 'Thanh toán và chi phí', 'Bao gồm xử lý tạm ứng công tác, quyết toán chi phí, thanh toán cho nhà cung cấp và xử lý hóa đơn/chứng từ.', 3);
INSERT INTO public."Categories" VALUES (6, 'Kế toán và kiểm soát', 'Bao gồm báo cáo tài chính, kiểm soát chi phí nội bộ, kê khai thuế và hỗ trợ số liệu bảng lương.', 3);
INSERT INTO public."Categories" VALUES (11, 'Quản lý an toàn', 'Bao gồm giám sát nội quy công ty, tập huấn PCCC', 6);
INSERT INTO public."Categories" VALUES (12, 'Quản lý tài sản và công cụ dụng cụ', 'Bao gồm theo dõi cấp phát laptop, ghế, bàn, đồ dùng,... và mua sắm thiết bị', 6);
INSERT INTO public."Categories" VALUES (9, 'Vận hành kinh doanh', 'Bao gồm kiểm tra tình trạng đơn hàng, hỗ trợ soạn thảo hợp đồng, báo giá và theo dõi doanh số.', 5);
INSERT INTO public."Categories" VALUES (8, 'Phát triển và định hướng sản phẩm', 'Bao gồm phân tích yêu cầu nghiệp vụ, lên lộ trình, nghiên cứu thị trường và xử lý yêu cầu tính năng mới.', 4);
INSERT INTO public."Categories" VALUES (10, 'Quan hệ khách hàng và giải pháp', 'Bao gồm tư vấn giải pháp, demo sản phẩm, chạy chương trình khuyến mãi và quản lý cơ hội bán hàng.', 5);
INSERT INTO public."Categories" VALUES (7, 'Chất lượng và tối ưu hóa', 'Bao gồm kiểm thử sản phẩm (UAT), báo lỗi, cải thiện trải nghiệm người dùng (UI/UX) và tối ưu hiệu năng hệ thống.', 4);


