2923,0.02043767,-0.0065808673,-0.010691956,-0.0026600657,0.016431209,-0.010833614,-0.002998399,-0.08438487,0.018075628,0.0006421385,-0.0018125043,0.007970304,-0.002495929,0.01668239,-0.005490804,-0.017764803,-0.0026807925,-0.005906913,-0.013759773,0.020332066,0.0020201956,0.0091101285]', 'Tài liệu về Hệ thống Nghiên cứu và xây dựng hệ thống xử lý tiếp nhận yêu cầu hỗ trợ (Ticket Management) dành cho công ty Videa

	

	Mục tiêu hệ thống

	Đề tài tập trung vào việc xây dựng một hệ thống phần mềm quản lý yêu cầu hỗ trợ tập trung, minh bạch và hiệu quả với các mục tiêu cụ thể sau:

	Tối ưu hóa quy trình cho người dùng: Xây dựng chức năng cho phép Người dùng dễ dàng tạo, gửi và theo dõi trạng thái các yêu cầu hỗ trợ (ticket) của mình thông qua một giao diện duy nhất.

	Nâng cao hiệu quả quản lý: Cung cấp cho trưởng phòng ban các công cụ để tiếp nhận, xem xét, phê duyệt hoặc từ chối yêu cầu. Hệ thống cho phép phân công nhiệm vụ xử lý cho Người dùng một cách rõ ràng, đồng thời giám sát được tiến độ và đóng ticket khi hoàn tất.

	Tạo môi trường làm việc cộng tác: Xây dựng một kênh trao đổi tập trung ngay trên ticket, cho phép các bên liên quan (người tạo, trưởng phòng, người xử lý) có thể bình luận, đính kèm tệp tin để làm rõ thông tin, thay thế cho các kênh liên lạc rời rạc hiện tại.

	Tự động hóa và báo cáo: Tự động gửi thông báo qua email đến các bên liên quan khi có cập nhật quan trọng về ticket. Hệ thống cũng cung cấp các chức năng thống kê, báo cáo giúp ban lãnh đạo có cái nhìn tổng quan về hiệu quả công việc và khối lượng yêu cầu hỗ trợ.

	Quản trị hệ thống linh hoạt: Cung cấp cho quản trị viên (Admin) các quyền quản lý người dùng, phòng ban, và các hạng mục hỗ trợ, đảm bảo hệ thống được vận hành một cách trơn tru và có tổ chức.

	

	Nhiệm vụ cơ bản của hệ thống

Hỗ trợ Người dùng và cán bộ trong công tác quản lý yêu cầu hỗ trợ nội bộ. Người dùng dễ dàng tạo ticket, nhập thông tin chi tiết (tiêu đề, nội dung, mức độ ưu tiên, hạng mục hỗ trợ, đính kèm tệp), đồng thời dễ dàng theo dõi tiến độ và trạng thái xử lý.

- Hệ thống hỗ trợ trưởng phòng ban trong việc tiếp nhận, phê duyệt hoặc từ chối yêu cầu hỗ trợ. Trưởng phòng ban có thể phân công nhiệm vụ trực tiếp cho Người dùng, giám sát tiến độ xử lý và thực hiện đóng ticket khi đã hoàn tất.', '{"source": "Khóa luận Tốt nghiệp Videa", "chunk_id": 0}');
