-0.01902465,0.023138257,-0.030718062,-0.0010673127,-0.033408638,0.006828947,-0.004967192,0.0224133,-0.01469973,0.018693037,-0.0076741255,-0.012286843,-0.0077064647,0.015628723,-0.027488805,0.0014523185,-0.077640064,0.014918226,-0.009261254,-0.0058263587,0.00616276,-0.009146376,0.020399632,-0.0031282322,-0.010455854,0.0028718975,-0.006058049,-0.014874876,0.016508859,-0.011833196,0.00999862]', '- Theo dõi và báo cáo số liệu liên quan đến quá trình xử lý ticket. Hệ thống cung cấp công cụ thống kê, báo cáo giúp quản lý dễ dàng đánh giá hiệu quả công việc và đưa ra cải tiến cho quy trình hỗ trợ.

- Tạo môi trường trao đổi, phối hợp công việc hiệu quả. Các bên liên quan trong ticket (người tạo, trưởng phòng ban, Người dùng được phân công) có thể trao đổi trực tiếp trong hệ thống thông qua tin nhắn, gửi hình ảnh hoặc file.

- Tích hợp thông báo tự động qua email. Khi có các sự kiện quan trọng (tạo ticket, từ chối, phân công, hoàn thành), hệ thống sẽ gửi thông báo cho các bên liên quan để đảm bảo tính minh bạch và kịp thời.

- Cung cấp chức năng quản trị hệ thống dành cho Admin. Admin có thể quản lý người dùng, phòng ban, hạng mục hỗ trợ, cũng như theo dõi danh sách ticket và số liệu thống kê toàn hệ thống.

	

