Admin hệ thống - System Administrator

Quản trị  hệ thống.

Đăng nhập bằng tài khoản Admin.




Quản lý tài khoản (tạo, sửa, khóa/mở), thêm sửa xóa phòng ban, Người dùng, hạng mục; xem báo cáo thống kê, danh sách ticket.

Quản trị tập trung, dễ dàng giám sát toàn hệ thống, hỗ trợ vận hành trơn tru.




2

Trưởng phòng ban (Head Department)

Quản lý, điều phối ticket trong phòng ban.

Nhận ticket từ hệ thống (qua email hoặc thông báo web).

Tiếp nhận hoặc từ chối ticket; nếu tiếp nhận thì phân công cho Người dùng xử lý; đóng ticket sau khi hoàn tất; tham gia trao đổi nội bộ.

Quản lý hiệu quả công việc phòng ban, nắm tiến độ xử lý, đảm bảo chất lượng hỗ trợ

