	Admin mở hệ thống, chọn đăng nhập bằng gmail và dùng gmail của mình để đăng nhập. Gmail này đã được hardcode thông tin với vai trò admin sẵn trong database

	Admin vào giao diện quản lý dành cho admin, chọn mục quản lý tài khoản và tiến hành tạo các tài khoản cho Người dùng với tên, phòng ban, gmail của Người dùng sau đó ấn lưu

	Thông tin của Người dùng sẽ được lưu trong database

	

	P02: Quy trình đăng nhập

	Người dùng mở hệ thống, chọn đăng nhập bằng gmail

	Hệ thống kiểm tra xem gmail đã được cấp trong database hay chưa

	Nếu chưa thì từ chối đăng nhập

	P03: Quy trình tạo ticket

	Người dùng đăng nhập vào hệ thống, chọn mục tạo ticket

	Người dùng nhập tiêu đề, nhập nội dung, chọn hạng mục hỗ trợ, chọn thời gian mong muốn hoàn thành, có thể đính kèm file sau đó chọn gửi

	Hệ thống cập nhật trạng thái ticket thành “Pending” (Chờ tiếp nhận)

	Hệ thống tự động gửi mail thông báo cho trưởng phòng ban

	P04: Quy trình tiếp nhận ticket

	Trường phòng ban truy cập ticket trong mục danh sách yêu cầu cần hỗ trợ hoặc truy cập qua đường link gắn trong mail thông báo gửi từ hệ thống

	Trưởng phòng ban xem xét và đánh giá yêu cầu

	Nếu yêu cầu không hợp lý: 

	Trưởng phòng ban chọn mục “Từ chối” và nhập lý do từ chối

	Hệ thống cập nhật trạng thái thành “Rejected”. Ticket sau đó không còn có thể tương tác hay chỉnh sửa nữa.

	Nếu yêu cầu hợp lý: 

	Trưởng phòng ban chọn “Tiếp nhận”, hệ thống cập nhật trạng thái ticket thành “Received”

	Trưởng phòng ban cập nhật mức độ ưu tiên cho ticket, cập nhật thời gian ước tính hoàn thành

