.015036794,0.008534236,-0.0050377166,-0.0120345075,-0.013620015,0.018232118,-0.02760605,0.0041313646,-0.07490781,0.014661966,-0.00073915464,0.00077105546,0.012335509,0.0005836991,0.018061632,0.013883767,-0.0090244,0.014604049,-0.005835528,-0.02074408,0.014821541,-0.0032726964,0.011728354]', 'Hệ thống tự động gửi mail thông báo cho những Người dùng được phân công

	Nếu yêu cầu thiếu thông tin, trưởng phòng ban có thể trao đổi với người tạo trong phần trao đổi nội bộ để yêu cầu người tạo bổ sung thêm thông tin, có thể đính kèm file, hoặc ảnh trong phần bình luận

	P05: Quy trình xử lý ticket

	Trưởng phòng được phân công truy cập ticket trong mục danh sách yêu cầu được phân công hoặc truy cập bằng đường link gắn trong mail thông báo từ hệ thống

	Nếu Trưởng phòng từ chối ticket thì cần nhập lý do thích đáng

	Hệ thống tự động gửi mail thông báo cho trưởng phòng ban để trưởng phòng ban phân công Trưởng phòng khác

	Nếu Ticket có trên một Trưởng phòng được phân công tiếp nhận xử lý, hệ thống cập nhật trạng thái ticket thành “In progress”

	Trưởng phòng sau khi trực tiếp xử lý yêu cầu thành công thì cần thay đổi trạng thái trong ticket thành “Complete” 

	

	P06: Quy trình đóng ticket

	Trưởng phòng ban đánh giá kết quả xử lý, nếu kết quả tốt:

	Trưởng phòng ban cập nhật trạng thái thành “Closed”, Ticket sau khi đóng sẽ chỉ ở trạng thái có thể xem, không thể tương tác

	Nếu kết quả không tốt, trưởng phòng ban có thể bình luận vào trong phần trao đổi nội bộ của ticket để Người dùng xử lý tiếp yêu cầu.

	

	P07: Quy trình cập nhật trạng thái ticket

	Chỉ những Người dùng có vai trò trong một ticket (Người tạo, trưởng phòng ban tiếp nhận hoặc Người dùng được phân công) mới có thể tương tác chỉnh sửa và truy cập trao đổi nội bộ trong ticket. Những Người dùng không liên quan chỉ có thể xem chi tiết ticket, không thể xem trao đổi nội bộ hay tương tác, chỉnh sửa

	Người dùng không thể cập nhật trạng thái ticket thành trạng thái cũ hơn

	Người tạo ticket chỉ cần theo dõi trạng thái và tiến trình xử lý của ticket không nên có quyền thay đổi trạng thái

	Chỉ trưởng phòng ban mới có thể đóng (closed) ticket

