Tên chức năng

Xem chi tiết ticket (F15)

Tác nhân

			Tất cả người dùng có quyền truy cập: Người tạo, nhân viên xử lý, trưởng phòng, admin.

Mô tả

			Cho phép người dùng xem thông tin chi tiết của một ticket, bao gồm mô tả, trạng thái, người phụ trách, lịch sử xử lý và bình luận.

