	Trưởng phòng ban và Người dùng được phân công có thể cập nhật trạng thái thành Complete

	P08: Quy trình quản trị hệ thống

	Admin truy cập vào trang giao diện dành cho quản trị viên. Admin có thể CRUD với: tài khoản người dùng, hạng mục hỗ trợ (Category), phòng ban (Departments), trạng thái ticket (Status). 

	Admin có thể cấu hình, cài đặt hệ thống, trực tiếp thay đổi cấu trúc database giúp mở rộng, cải thiện nghiệp vụ, quy trình làm việc.

	

	

	6. Đặc tả chức năng

	Quản lý tài khoản và người dùng

	Cấp tài khoản

Tên chức năng

Cấp tài khoản (F1)

Tác nhân

			Admin, Trưởng phòng ban nhân sự

Mô tả

			Tạo mới tài khoản Người dùng cùng các thông tin Người dùng (kèm gmail cá nhân để Người dùng dùng đăng nhập vào hệ thống)

Đầu vào

			Họ tên, email, vai trò, phòng ban, giới tính, username, mã phòng ban.

Đầu ra

			Tài khoản được cấp cho người dùng với các quyền truy cập phù hợp.

Điều kiện trước

			Admin hoặc Người dùng thuộc phòng ban HR đăng nhập bằng gmail (thông tin về quyền, phòng ban của Admin và các Người dùng được thêm vào db ngay từ đầu)

Điều kiện sau

			- Tài khoản người dùng được cấp thành công và lưu vào cơ sở dữ liệu.

			- Người dùng có thể sử dụng gmail để đăng nhập vào hệ thống

Luồng sự kiện chính

			Admin hoặc Người dùng từ phòng HR đăng nhập vào hệ thống với quyền tương ứng

			Chọn chức năng “Quản lý tài khoản” từ menu quản lý tài khoản

			Nhập thông tin tài khoản

			Hệ thống kiểm tra tính hợp lệ của thông tin (email chưa tồn tại, quyền phù hợp, …).

			Nhấn nút "Xác nhận" để tạo tài khoản.

			Hệ thống tạo tài khoản, lưu vào cơ sở dữ liệu và thông báo "Tài khoản đã được cấp thành công".

Ngoại lệ

			Nếu thông tin không đầy đủ hoặc không hợp lệ, hệ thống sẽ thông báo lỗi.

