	Bảng 2.14. Quản lý tài khoản và người dùng 

	

	Đăng nhập

Tên chức năng

Đăng nhập (F2)

Tác nhân

			Toàn bộ Người dùng

Mô tả

			Đăng nhập vào hệ thống bằng Gmail thông qua Google OAuth 2.0.

Đầu vào

			Email, mật khẩu gmail cá nhân.

Đầu ra

			Phiên đăng nhập thành công hoặc thông báo lỗi.

Điều kiện trước

			Người dùng có tài khoản Gmail hợp lệ (đã được admin hoặc HR tạo trong Db).

Điều kiện sau

			Người dùng truy cập vào hệ thống với vai trò được phân quyền.

Luồng sự kiện chính

			Người dùng chọn “Đăng nhập bằng Gmail”.

			Hệ thống điều hướng đến trang đăng nhập bằng Google

			Người dùng nhập thông tin Gmail.

			Hệ thống kiểm tra gmail có trong Database hay chưa sau đó redirect sang trang đăng nhập của Google

			Google xác thực và trả về authorization code

			Hệ thống nhận code này để tạo JWT token cùng với Refresh Token và lưu db, server trả tokens cho client.

Ngoại lệ

			

Các yêu cầu đặc biệt

			

	Bảng 2.15. Đăng nhập

	

	Đăng xuất

Tên chức năng

Đăng xuất (F3)

Tác nhân

			Toàn bộ Người dùng

Mô tả

			Đăng xuất khỏi hệ thống và kết thúc phiên đăng nhập

Đầu vào

			Yêu cầu đăng xuất.

Đầu ra

			Phiên làm việc bị hủy, chuyển về màn hình đăng nhập

Điều kiện trước

			Người dùng đang đăng nhập.

Điều kiện sau

			Phiên đăng nhập không còn hiệu lực.

Luồng sự kiện chính

			Người dùng chọn “Đăng xuất”.

			Hệ thống xóa token trong database (Redis) và trong cookie (client) đối với người dùng đó

			Hệ thống điều hướng về trang đăng nhập.

Ngoại lệ

			

Các yêu cầu đặc biệt

			Đảm bảo hủy toàn bộ tokens trong cookie và redis database

			

	Bảng 2.16. Đăng xuất

	

	Chỉnh sửa thông tin người dùng

Tên chức năng

Chỉnh sửa thông tin người dùng (F4)

Tác nhân

			Admin, bộ phận HR

Mô tả

			Chỉnh sửa thông tin người dùng.

Đầu vào

			Mã tài khoản, thông tin mới.

Đầu ra

