	Hoàn tất xử lý Ticket

Tên chức năng

Hoàn tất xử lý Ticket (F13)

Tác nhân

			Người dùng được phân công

Mô tả

			Người dùng được phân công xác nhận hoàn tất xử lý ticket bằng cách.

Đầu vào

			Mã Ticket

Đầu ra

			Mail thông báo kèm đường dẫn tới ticket

Điều kiện trước

			Ticket đang ở trạng thái Pending.

