	Đóng ticket

Tên chức năng

Đóng ticket (F14)

Tác nhân

			Trưởng phòng ban

Mô tả

			Khi công việc hoặc yêu cầu trong ticket đã được hoàn thành, người phụ trách có thể đóng ticket để kết thúc quy trình.

