012913127,0.01423559,-0.009647023,-0.0059947693,-0.08912169,-0.0033195755,0.000500813,0.014479541,0.019435778,0.009590633,-0.0034874794,-0.0024175295,-0.011048936,0.0004233197,-0.024430383,0.007487049,-0.0029465053,-0.0068483967,0.014101356]', 'Phòng Nhân sự (HR)

	Các hạng mục hỗ trợ:

	Hành chính và phúc lợi: Bao gồm quản lý hợp đồng lao động, tính lương/thưởng, giải quyết nghỉ phép, hồ sơ nhân viên và các chính sách công ty.

	Tuyển dụng và đào tạo: Bao gồm đăng tin tuyển dụng, tiếp nhận nhân sự mới, đào tạo phát triển kỹ năng và đánh giá hiệu suất nhân viên.

	Phòng Tài chính (Finance)

	Các hạng mục hỗ trợ:

	Thanh toán và chi phí: Bao gồm xử lý tạm ứng công tác, quyết toán chi phí, thanh toán cho nhà cung cấp và xử lý hóa đơn/chứng từ.

	Kế toán và kiểm soát: Bao gồm báo cáo tài chính, kiểm soát chi phí nội bộ, kê khai thuế và hỗ trợ số liệu bảng lương.

	Phòng CSKH (Customer Service)

	Các hạng mục hỗ trợ:

	Xử lý khiếu nại và sự cố: Bao gồm giải quyết khiếu nại, yêu cầu hoàn tiền, xử lý đơn hàng lỗi, giao hàng chậm và hỗ trợ kỹ thuật cho khách.

	Tư vấn và thông tin khách hàng: Bao gồm tư vấn sản phẩm/dịch vụ, xác minh tài khoản, cập nhật thông tin khách hàng và thu thập phản hồi.

	Phòng Sản phẩm (Product)

	Các hạng mục hỗ trợ:

	Phát triển và định hướng sản phẩm: Bao gồm phân tích yêu cầu nghiệp vụ, lên lộ trình, nghiên cứu thị trường và xử lý yêu cầu tính năng mới.

	Chất lượng và tối ưu hóa: Bao gồm kiểm thử sản phẩm (UAT), báo lỗi, cải thiện trải nghiệm người dùng (UI/UX) và tối ưu hiệu năng hệ thống.

	Phòng Kinh doanh (Sales)

	Các hạng mục hỗ trợ:

	Vận hành kinh doanh: Bao gồm kiểm tra tình trạng đơn hàng, hỗ trợ soạn thảo hợp đồng, báo giá và theo dõi doanh số.

	Quan hệ khách hàng và giải pháp: Bao gồm tư vấn giải pháp, demo sản phẩm, chạy chương trình khuyến mãi và quản lý cơ hội bán hàng.', '{"source": "Khóa luận Tốt nghiệp Videa", "chunk_id": 20}');


